     , (14414, 12, 13, 3, 10, 3, 1, NULL, 'There must be connection here...could the Hollow Minions be taking the skins from their victims in order to fill them with the portal space in those spherules Rylanan told me about? All to clothe them in our Guards uniforms? This must be a plot to strike down our Queen! Every one knows that our station here is intended only to be temporary--we''re only here to restore stability and then return to her. This is terrible...I''m never going home, am I? Alright, pull yourself together, soldier!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL) /* Tell_EmoteType */
     , (14414, 12, 13, 4, 10, 3, 1, NULL, 'We have heard that a group of Hollow Minions have recently claimed Fort Witshire and barricaded themselves inside. Now that I think of it, this must be where their headquarters for this plot are located. It has long been known that Fort Witshire was built upon the ruins of an old Empyrean prison. We have been planning to infiltrate the fort by using the hidden corridors deep beneath the fort--and you seem like just the person to help us with this.   Here is a key that was found among Witshire''s effects--it may be useful when you reach the surface to enter the fort.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL) /* Tell_EmoteType */
